package pages;import org.openqa.selenium.WebDriver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.openqa.selenium.support.PageFactory;import utilities.Driver;public class VyTrackDashboard {    WebDriver driver= Driver.getDriver();    public VyTrackDashboard(WebDriver driver) {        this.driver = driver;        PageFactory.initElements(driver, this);    }    @FindBy(xpath = "//i[@class='fa-caret-down']")    public WebElement userMenu;    @FindBy(linkText = "Logout")    public WebElement logOut;    @FindBy(xpath = "//h1[@class='oro-subtitle']")    public WebElement dashHead;}